measurements.description:
One impressive flower on one upright 22.2-cm inflorescence;

 dorsal sepal white, margins overlaid rose pink, dark magenta venation;
 synsepal chartreuse, dark rose stripes;
 petals broadly ovate, white, dark pink venation, margins blushed rose;
 pouch white, blushed rose pink upper half;
 staminode oval, white, yellow centrally, spotted burgundy;
 substance firm; texture matte.
